import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <div className="w-64 min-h-screen bg-blue-600 text-white fixed flex flex-col items-center py-10">
      <h2 className="text-2xl font-bold mb-8">MediCare</h2>
      <nav className="flex flex-col space-y-4">
        <Link to="/" className="text-lg hover:bg-blue-500 px-6 py-2 rounded">Home</Link>
        <Link to="/doctor-register" className="text-lg hover:bg-blue-500 px-6 py-2 rounded">Doctor Register</Link>
        <Link to="/patient-register" className="text-lg hover:bg-blue-500 px-6 py-2 rounded">Patient Register</Link>
        <Link to="/pharmacy-register" className="text-lg hover:bg-blue-500 px-6 py-2 rounded">Pharmacy Register</Link>
        <Link to="/login" className="text-lg hover:bg-blue-500 px-6 py-2 rounded">Login</Link>
      </nav>
    </div>
  );
};

export default Sidebar;
